It all starts with a #REDNOTICE for the two greatest art thieves in the world. 

Hunted down by the FBI’s top profiler. 

Three people who are the best at what they do. 

And the greatest conman the world has never seen…… 

@gal_gadot, @vancityreynolds and I are bringing you @Netflix’s biggest film ever on NOVEMBER 12th. 

Written & Directed by @RawsonThurber 

Time to raise the streaming bar. 

#REDNOTICE 🔥
@SevenBucksProd
@FlynnPictureCo

